import { FaShoppingCart } from "react-icons/fa";

const Navbar = () => {
  return (
    <div>
      <div className="flex flex-row justify-between">
        <img src="data:image/png;base64,"/>
        <div>
          <p>Home</p>
          <FaShoppingCart />
        </div>
      </div>
    </div>
  )
};

export default Navbar;
